  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:08.931806\",\n\t\"name\": \"a-biological-survey-of-nunivak-island-july-1985\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Results of a biological survey of Nunivak
  Island, July 2-25, 1985. 755 birds, comprising 24 species were recorded on 12 bird
  transects. Waterfowl and shorebirds were predominant. Nine habitat types were identified:
  Dry Crowberry Tundra, Alpine Crowberry Tundra, Barren Boulder Fields, Dune Complexes,
  Tidal Pools/Backshores, Grass Sedge Hummocks, Sedge Meadow Tundra, Riparian Tundra,
  and Cliff tops. These habitat types are all characterized by low growth form plants.
  However, the Riparian Tundra does contain 2m willows, the tallest trees on the island.
  Snap trapping yielded only one small mammal, an arctic shrew during 700 trap nights.
  Small mammal populations appear very low at this time. Approximately 15-20 musk
  ox and 35-50 reindeer were observed, some animals daily.\",\n\t\"license_title\":
